description:
Go Play City Sports recreates the experience of playing sports in the city as a kid. Become the neighborhoodtop athlete by competing in six classic games and rule the courts made of manhole covers, fire hydrants and parked cars. This collection of classic street games provides a fun, casual sports experience for the whole family.
